                new { Url = "https://www.hellomagazine.com/", Title = "HELLO! - Daily royal, celebrity, fashion, beauty ...", Caption = "<strong>HELLO</strong>! brings you the latest celebrity &amp; royal news from the UK &amp; around the world, magazine exclusives, fashion, beauty, lifestyle news, celeb babies, weddings, pregnancies and more!" },
                new { Url = "https://dictionary.cambridge.org/dictionary/english/hello", Title = "HELLO | meaning in the Cambridge English Dictionary", Caption = "<strong>hello</strong> definition: 1. used when meeting or greeting someone: 2. something that is said at the beginning of a phone…. Learn more." },
                new { Url = "https://en.wikipedia.org/wiki/Hello", Title = "Hello - Wikipedia", Caption = default(string) },
                new { Url = "https://www.dictionary.com/browse/hello", Title = "Hello | Definition of Hello at Dictionary.com", Caption = "<span class=\"news_dt\">17/11/2018</span>&nbsp;· (used to express a greeting, answer a telephone, or attract attention.) (an exclamation of surprise, wonder, elation, etc.) (used derisively to question the comprehension, intelligence, or …" },
                new { Url = "https://www.hello.com/en/index.html", Title = "hello network", Caption = "<strong>hello</strong> has 1000s of communities! Create or join communities to connect around your specific interests." },
                new { Url = "https://www.hellofresh.co.uk/", Title = "HelloFresh: #1 Recipe Box Delivery Service | Dinner is Solved", Caption = "UK's Leading Recipe Box Fresh, Quality Ingredients Even More Recipe Choice and Variety Flexible Subscription | Free Delivery - Get Started Now!" }
            };

            var parser = new HtmlParser();
            var document = parser.ParseDocument(testHtml);

            var htmlParserMock = new Mock<IAngleSharpHtmlParser>();
            htmlParserMock.Setup(x => x.Parse(It.IsAny<string>())).Returns(document);

            var queryStringEncoderMock = new Mock<IQueryStringEncoder>();
            queryStringEncoderMock.Setup(x => x.Encode(It.IsAny<string>())).Returns(searchTerm);

            var config = new ConfigurationBuilder().AddJsonFile("appsettings.json").Build();

            var searchEngineSelector = new BingSearchEngineSelector(config["BingUrlSelector"],
                                                                         config["BingTitleSelector"],
                                                                         config["BingCaptionSelector"]);

            var searchEngine = new SearchEngine(htmlParserMock.Object,
                                                searchEngineSelector,
                                                queryStringEncoderMock.Object,
                                                "https://test.com/search",
                                                config["BingSearchResultSelector"]);

            // act
            var results = searchEngine.GetSearchResults(searchTerm).ToList();

            // assert
            Assert.IsNotNull(results);
            Assert.AreEqual(6, results.Count());

            for (int i = 0; i < results.Count(); i++)
            {
                Assert.AreEqual(expectedResults[i].Url, results[i].Url);
                Assert.AreEqual(expectedResults[i].Title, results[i].Title);
                Assert.AreEqual(expectedResults[i].Caption, results[i].Caption);
            }
        }
